class Createbar extends React.Component {
  constructor(props) {
  super(props);
  this.state = { open: false, selectedItems: [], items:[] };
  this.setSelectedItems = this.setSelectedItems.bind(this);
}
componentDidMount(){
  axios.get('/allbars').then(response => {
    console.log(response);
      this.setState({
        items: response.data
      })
    })
}
  render() {
    return (
      <Page
